//          PROPS/STATES CUSTOM ATTRIBUTES OF COMPONENTS IN REACT.JS         \\

/*
        Define PROPS/STATES :
              The FullForm of PROPS is Properties , In ReactJS the Custom Attributes of the Component's Elements is called Props/States.
               To makes the Props of the Component's Element Just Gives the Custom Attributes to Component's Element ,
                The Custom Attrbutes must not have the Same keywords that is Reserved by the JavaScript or Other HTML Atttributes. 

          // The Props is very helpfull to save us from the HardCore of the HTML.
*/


// Importing Required Modules :
import React from 'react';
import ReactDOM from 'react-dom';

// Importing Main Component :
import Prs from './Profile'
// Importing CSS :
import "./index.css"

// Importng the Requried Images/Data :
// import junaid from './static/junaid.jpg'
// import zahid from './static/zahid.jpg'
// import tayyab from './static/tayyab.jpg'
// import zulifqar from './static/zulifqar.jpg'
// import shahzaib from './static/shahzaib.jpg'

import ProfileData from './ProfileData';

// Rendering : 
// The Given Work is Defined the Way to make Custom Attributes for the Component , and is called Props.
ReactDOM.render(
    <>
        <nav id="nav">OUR DEVELOPER TEAM</nav>
        <div id="profileSection">
            <Prs
                proname={ProfileData[0].proname}
                proimg={ProfileData[0].proimg}
                prolink={ProfileData[0].prolink}
            />
            <Prs
                proname={ProfileData[1].proname}
                proimg={ProfileData[1].proimg}
                prolink={ProfileData[1].prolink}
            />
            <Prs
                proname={ProfileData[2].proname}
                proimg={ProfileData[2].proimg}
                prolink={ProfileData[2].prolink}
            />
            <Prs
                proname={ProfileData[3].proname}
                proimg={ProfileData[3].proimg}
                prolink={ProfileData[3].prolink}
            />
            <Prs
                proname={ProfileData[4].proname}
                proimg={ProfileData[4].proimg}
                prolink={ProfileData[4].prolink}
            />
        </div>
        <footer id="footer">&copy; Copyrights   |   All Rights Reserved</footer>
    </>, document.getElementById('root')
)
